import React from 'react';
import './dashboard.css';
import axios from 'axios';
import { useState, useEffect } from 'react';
import ProjectComponent from './ProjectComponent/boxcomp';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faEdit } from '@fortawesome/free-solid-svg-icons'; // Import the edit icon

const DashBoard = (props) => {
    const { email } = props;
    const [projectList, setProjectList] = useState([]); // Initialize with an empty array

    const getProject = async () => {
        const response = await axios.post('http://localhost:3001/get-projects', {
            email: email
        });
        setProjectList(response.data);
    }

    useEffect(() => {
        getProject();
    }, [email]);

    return (
        <div className='dashboard_container'>
            <h1 className='dashboard-heading'>Account</h1>
            <br />
            <h2>
                Create a Project <span className="plus-icon">+</span>
            </h2>
            <div className="dashboard">
                {projectList.map(project => (
                    <ProjectComponent key={project.id} data={project} />
                ))}
            </div>
        </div>
    );
};

export default DashBoard;
